import React from "react";


//props 이름: fav
//fav에 "sushi"라는 값을 담아 Food 컴포넌트에 보냄
// props에 있는 데이터는 문자열인 경우를 제외하면 모두 중괄호로 값을 감싼다.

function App() {
  return (
    <div>
      <h1>Hello World</h1>
      <Food fav="sushi"/>
    </div>

  ); 
}

// props가 전달되는 과정
// Food 컴포넌트에 설정한 props가 전달됨
// props를 출력
function Food(props) {
  return <h1>I LIKE {props.fav}</h1>
}



export default App;
